"33070" : {
"id":33070,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Aanvragen indicatie    Mevrouw Romer MPT, extra budget, extra aanbieders   Mevrouw Romer (13-03-1971) ontvangt zorg thuis op basis van een Wlz-indicatie afgegeven in 2011. Haar situatie is in de loop van de tijd ernstig verslechterd en  haar zorgvraag toegenomen. In overleg met Heidehof die op dit moment de zorg thuis levert, vraagt zij bij het CIZ een herindicatie aan. Op 11 oktober geeft  het CIZ een nieuwe indicatie af voor 6VV. Hiermee eindigt de geldigheid van de  oude indicatie op 10 oktober.  N.B. De intrekking van de zorgtoewijzing behorende bij de oude indicatie is niet in deze casus opgenomen. Op deze intrekking, die alleen naar Heidehof gestuurd wordt, reageert Heidehof niet met een melding einde zorg (MUT, AW39), omdat de zorglevering op de betreffende zorgtoewijzing eindigt op de einddatum van de zorgtoewijzing.  Op 11 oktober stuurt het CIZ het volgende indicatiebesluit naar het zorgkantoor.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
