"33083" : {
"id":33083,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 3: Aanvragen aangepaste zorgtoewijzing  In overleg met mevrouw Romer zal de zorg geleverd worden door  drie aanbieders: Boshoek, Heidehof en De Oase. Heidehof wordt de (nieuwe) coordinator zorg thuis.  Op 12 oktober stuurt Boshoek een aanvraag aangepaste zorgtoewijzing (AAT) naar het zorgkantoor. In deze AAT worden zorgtoewijzingen aangevraagd voor de drie genoemde aanbieders.  Op basis van het zorgplan is de rekenmodule ingevuld en blijkt dat  het budget voor zorgprofiel 6VV met leveringsvorm MPT met 30% overschreden wordt. In de AAT is het totaal van de aangevraagde percentages 130. Dit betekent dat de zorg niet doelmatig geleverd  kan worden. Boshoek stuurt de rekenmodule als onderbouwing op  naar het zorgkantoor.  Boshoek heeft, als voorkeuraanbieder voor de levering van het MPT, de (tot nog toe enige) zorgtoewijzing van het zorgkantoor ontvangen  en is daarmee op dit moment de Coordinator zorg thuis.  Boshoek is daarom de aanbieder die de aangepaste zorgtoewijzing aanvraagt. In de AAT vult Boshoek in dat 'Heidehof' de nieuwe Coordinator zorg thuis wordt. Het zorgkantoor weet dan dat Heidehof de nieuwe Coordinator zorg thuis is. Een volgende AAT mag  uitsluitend gedaan worden door Heidehof.  In de AW39 is geen Mutatie opgenomen; Boshoek kan de zorg  immers direct leveren. Het bericht bevat alleen een Aanvraag. Deze Aanvraag is bedoeld om de zorgtoewijzing te verdelen tussen de drie aanbieders en om meer budget aan te vragen.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
