"33612" : {
"id":33612,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Inleiding: Casus is een vervolg op 3A waarin Dhr De Groot ter overbrugging thuiszorg ontvangt in de vorm van een MPT.  Met ingang van 3 december heeft Berkenbos een kamer vrij voor de heer De Groot. Een week later verhuist de heer De Groot naar Berkenbos.  In dit voorbeeld (3B-1) stuurt de zorgaanbieder een MAZ voor het  verblijf (de opname) en stuurt het zorgkantoor vervolgens een  intrekking van de zorgtoewijzing voor de overbruggingszorg die  geleverd wordt in de vorm van een MPT.  Een andere mogelijkheid is dat de zorgaanbieder zowel een MAZ voor het verblijf als een MUT19 (einde zorg) voor de overbruggingszorg  (het MPT) stuurt. Het zorgkantoor stuurt in dat geval geen intrekking  van de zorgtoewijzing (AW33). Deze situatie is uitgewerkt bij 3B-2.  Hieronder is de laatste toewijzing opgenomen die de zorgaanbieder  heeft ontvangen.Hierop heeft de zorgaanbieder al gereageerd met een melding aanvang zorg MPT.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"33598" : {
"id":33598,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Melden aanvang zorg  Op 11 december stuurt Berkenbos een melding aanvang zorg voor de opname van de heer De Groot.  Berkenbos heeft al een reguliere zorgtoewijzing voor  verblijf (zie inleiding / ontvangen op 1 augustus) en kan  daar rechtstreeks een melding aanvang zorg (MAZ) op sturen. Een aanvraag aangepaste zorgtoewijzing (AAT) is hier niet van toepassing.   De aanbieder bij wie de client woont levert ook  behandeling. Dit vermeldt hij in de melding aanvang zorg.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"33630" : {
"id":33630,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 2: Intrekken overbruggingszorg (MPT)  Op basis van de melding aanvang zorg voor de opname, concludeert het zorgkantoor dat de heer De Groot is opgenomen. Het zorgkantoor trekt de zorgtoewijzing voor  de overbruggingszorg in. Omdat een AW33 altijd het complete beeld van de actuele zorgtoewijzingen bevat, neemt het zorgkantoor de eerder verzonden reguliere zorgtoewijzing voor het verblijf ook in dit bericht op.  Het zorgkantoor stuur Berkenbos een AW33.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
