"35590" : {
"id":35590,
"typeIconPath":"data/icons/ArchiMate/AllViewRef.png",
"data" : [
{
"lang":"nl",
"name":"Beoordelen",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De keten van processen in de Wlz wordt opgestart op het moment dat een client een aanvraag doet voor een indicatie voor Wlz-zorg. Voor bestaande clienten kan dit ook gaan om een aanvraag voor een herindicatie.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Bij het proces indiceren zijn twee partijen betrokken: het CIZ dat de indicatie stelt en het zorgkantoor dat de indicatie ontvangt. Nadat een client heeft aangegeven zorg nodig te hebben, bepaalt het CIZ op welke en op hoeveel zorg de klant recht heeft. Dit wordt vastgelegd in het indicatiebesluit. Dit besluit wordt in een indicatiebesluitbericht (IO31) via iWlz naar het zorgkantoor verstuurd. Het zorgkantoor bevestigt de ontvangst van het indicatiebesluitbericht door een retourbericht (IO32) te sturen naar het CIZ. Het zorgkantoor weet nu waar de client recht op heeft volgens de Wet langdurige zorg (Wlz). Het zorgkantoor is vervolgens verantwoordelijk voor de toewijzing van de zorg aan &#233;&#233;n of meer zorgaanbieders, die de zorg moeten gaan leveren.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In principe is een indicatie met de bijbehorende zorgtoewijzingen geldig tot de daarop vermelde einddatum. In de Wlz zijn de meeste indicaties levenslang geldig; dergelijke indicaties bevatten geen einddatum. Op het moment dat er aanleiding is een nieuwe indicatie aan te vragen vervalt echter deze geldigheid en zal er op basis van de nieuwe indicatie opnieuw toegewezen en gemeld moeten worden. In de uitwerking van de verschillende deelprocessen zijn de diverse aanleidingen opgenomen, die leiden tot veranderingen in het berichtenverkeer. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
