"35875" : {
"id":35875,
"typeIconPath":"data/icons/ArchiMate/AllViewRef.png",
"data" : [
{
"lang":"nl",
"name":"Leveren",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Zodra een zorgaanbieder gestart is met het leveren van de toegewezen zorg, meldt hij dit aan het zorgkantoor met een melding aanvang zorgbericht. In dit bericht geeft de zorgaanbieder aan wanneer hij met de levering van de toegewezen zorg gestart is. Het is van belang dat de zorgaanbieder deze informatie juist, volledig en tijdig verstuurt aan het zorgkantoor omdat het zorgkantoor op basis van deze gegevens een melding doet aan het CAK. Het CAK start met deze informatie het proces dat leidt tot de vaststelling van de eigen bijdrage voor intramurale zorg.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer het zorgkantoor de aan een zorgaanbieder toegewezen zorg wil wijzigen of voortijdig wil intrekken, stuurt het zorgkantoor hiervoor een nieuw zorgtoewijzingbericht. &nbsp;<p style=\"margin-top: 3pt;\">De zorgaanbieder kan hieruit afleiden welke wijzigingen voor hem van toepassing zijn. Als de aanbieder de zorglevering stopt op de einddatum van de zorgtoewijzing (de intrekking), stuurt hij geen einde zorgbericht. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Zorgtoewijzingberichten worden altijd naar alle aanbieders gestuurd die bij de zorglevering aan de client betrokken zijn. Aanbieders voor wie de zorgtoewijzing ongewijzigd is, reageren hierop niet met een bericht.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer de geleverde zorg op initiatief van de client of de zorgaanbieder voortijdig beeindigd wordt, meldt de zorgaanbieder dit met een melding einde zorg aan het zorgkantoor. Het zorgkantoor bericht vervolgens het CAK over dit einde, tenzij er sprake is van overlijden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
