"name":"Stap 1: Aanvragen aangepaste zorgtoewijzing  De Appelboom vraagt in zijn rol als coordinator zorg thuis een aangepaste zorgtoewijzing aan voor de gewenste nieuwe verdeling van de zorglevering tussen de twee aanbieders.   Op 4 juni stuurt De Appelboom een aangevraag aangepaste zorgtoewijzing naar het zorgkantoor.",
