"lang":"nl",
"name":"Stap 4: Toewijzen aangevraagde zorg  De volgende dag keurt het zorgkantoor de aanvraag goed. De Appelboom en Het Klokhuis ontvangen op 3 mei allebei de volgende zorgtoewijzing.",
