"35941" : {
"id":35941,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 3: Aanvragen aangepaste zorgtoewijzing  In overleg met Kees wordt besloten dat Het Klokhuis een deel van de behandeling voor zijn rekening zal nemen. Na invullen van de rekenmodule blijkt dat dit in percentages uitgedrukt neerkomt op een verdeling van 80-20. De behandeling past binnen het budget dat beschikbaar is voor 4LVG met leveringsvorm MPT.  De Appelboom (coordinator zorg thuis) vraagt op 2 mei een aangepaste zorgtoewijzing aan voor de verdeling van de zorglevering tussen de twee aanbieders.   In de AW39 is geen Mutatie opgenomen; De Appelboom kan  de zorg immers direct leveren. Het bericht bevat alleen een Aanvraag om de zorgtoewijzing te verdelen tussen beide aanbieders.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
