"35995" : {
"id":35995,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Aanvragen aangepaste zorgtoewijzing   Myrthe de Wit gaat naar de dagbesteding bij De Zorghoeve en staat op de  wachtlijst voor opname bij Duinzicht. Op 24 juni neemt Duinzicht contact op met de ouders van Myrthe om door te geven dat er met ingang van 2 juli een plek is voor Myrthe. Afgesproken wordt dat Myrthe op 2 juli verhuist naar Duinzicht.   Zodra bekend is dat Myrthe op 2 juli bij Duinzicht opgenomen kan worden, stuurt Duinzicht een nieuwe aanvraag aangepaste zorgtoewijzing (AAT). Hierin wordt de zorg verdeeld over Duinzicht en De Zorghoeve. Voor De Zorghoeve  wordt nu een reguliere zorgtoewijzing aangevraagd met leveringsvorm verblijf  (geen opname).   Omdat de leveringsstatus niet verandert, is geen sprake van een Mutatie en wordt  er alleen een Aanvraag verstuurd.   De Aanvraag kan in dit geval met een ingangsdatum in de (nabije) toekomst verstuurd worden. Als het bericht een Mutatie zou bevatten, is dat niet mogelijk, omdat de mutatiedatum niet in de toekomst mag liggen.   De dossierhouder neemt in de AAT uitsluitend de aanvragen voor de nieuwe zorgtoewijzingen met de nieuwe percentages op. Het zorgkantoor zal de  voorgaande zorgtoewijzingen (in beide gevallen dezelfde zorgeenheid, voor  dezelfde aanbieder, met dezelfde soort en dezelfde leveringsvorm) op grond van  de overlapregels intrekken.   Overlap van √©√©n dag is in deze situatie niet toegestaan.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
