"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Aanvragen indicatie  De heer De Groot Nog geen opname mogelijk bij voorkeuraanbieder Berkenbos, wel  start dagbesteding bij Berkenbos.  De heer De Groot (02-03-1951), weduwnaar, lichamelijk gehandicapt geraakt na ongeval. 1e grondslag Lichamelijke handicap (functiestoornis), 2e grondslag Somatische ziekte / aandoening. Momenteel ontvangt meneer mantelzorg door kinderen en vrienden, maar hij wil graag bij Berkenbos wonen omdat hij meer structuur en begeleiding nodig heeft. Vanuit de WMO gaat hij al naar de dagbesteding bij Berkenbos.   Hij krijgt per 1 augustus een indicatie voor 4LG.  Op 1 augustus stuurt het CIZ het volgende indicatiebesluit naar het zorgkantoor.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
