"36208" : {
"id":36208,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Inleiding: Casus 6B is een vervolg op Casus 6A waarin de heer √áelik ter overbrugging verblijft bij een andere aanbieder dan zijn voorkeuraanbieder.  Nu is er ruimte bij de voorkeuraanbieder en gaat de heer √áelik verhuizen. Op 12 juni verhuist de heer √áelik naar Zonzicht.  Er zijn twee varianten. Dit is variant 1.  In dit voorbeeld (6B-1) verneemt het zorgkantoor door middel van de melding aanvang zorg van Zonzicht dat de client bij Zonzicht is opgenomen. Naar aanleiding van dit bericht trekt het zorgkantoor de zorgtoewijzing voor de overbruggingszorg (transfer) bij Veldzicht in. Veldzicht stuurt geen mutatiebericht om het einde van de zorglevering te melden omdat de zorglevering eindigt op de einddatum van de zorgtoewijzing (de intrekking).   Hieronder is de laatste toewijzing opgenomen die de zorgaanbieder heeft ontvangen.Hierop heeft de zorgaanbieder voor overbruggingszorg  gereageerd met een melding aanvang zorg Verblijf.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
