"36318" : {
"id":36318,
"typeIconPath":"data/icons/ArchiMate/AllViewRef.png",
"data" : [
{
"lang":"nl",
"name":"Toeleiden",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In het zorgtoewijzingsproces communiceren zorgkantoor en &#233;&#233;n of meer zorgaanbieders met elkaar. Het zorgkantoor maakt altijd een nieuw zorgtoewijzingbericht nadat het een nieuw indicatiebesluit heeft ontvangen van het CIZ. De client kan een voorkeur voor een leveringsvorm (alleen bij een zorgzwaartepakket) en voor een aanbieder opgeven. Wanneer de client dit op het moment van indiceren nog niet bij het indicatieorgaan heeft aangegeven neemt het zorgkantoor contact op met de client om dit alsnog vast te stellen. Het zorgkantoor stuurt een zorgtoewijzingbericht voor de geindiceerde zorgeenheid, met de door de client gewenste leveringsvorm naar de voorkeuraanbieder van de client. Indien sprake is van een volledig pakket thuis of verblijf, heeft de voorkeuraanbieder de rol van dossierhouder. Indien sprake is van de leveringsvorm modulair pakket thuis heeft de voorkeuraanbieder de rol van coordinator zorg thuis. Een aanbieder die de rol van dossierhouder en/of coordinator zorg thuis heeft, mag bij het zorgkantoor een aanvraag doen voor een aangepaste zorgtoewijzing voor (bijvoorbeeld) de levering van overbruggingszorg, de verdeling van de zorglevering over meer aanbieders, een hoger budget ten behoeve van ondoelmatige levering (bijzondere situatie) van een modulair pakket thuis. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het zorgkantoor is ervoor verantwoordelijk dat de client binnen aanvaardbare wachttijden zorg ontvangt en houdt in de gaten wanneer de zorg start.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het zorgkantoor stuurt een zorgtoewijzingbericht altijd naar alle zorgaanbieders die bij de zorglevering aan de client betrokken zijn. Op die manier informeert het zorgkantoor alle betrokken zorgaanbieders ook over de zorg die andere zorgaanbieders (gaan) leveren aan die client op grond van dezelfde indicatie. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
