"name":"Stap 6: Melden aanvang zorg CAK  Naar aanleiding van de meldingen aanvang zorg van Zeezorg en De Molen geeft het zorgkantoor de start van de zorglevering door aan het CAK.    Als startdatum hanteert het zorgkantoor de sleuteldatum van De Molen.   Vanaf die datum is er een eigen bijdrage verschuldigd.",
