"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 3: Aanvragen aangepaste zorgtoewijzing  Dirk kan meteen bij De Molen gaan wonen. Voor de dagbesteding wil hij graag naar Zeezorg. De Molen  vraagt een aangepaste zorgtoewijzing aan in verband  met de verdeling van de zorglevering tussen De Molen  en Zeezorg.  Hoewel De Molen Dirk direct kan opnemen, stuurt De Molen nog geen melding aanvang zorg. Dat zou namelijk betekenen dat De Molen het toegewezen percentage (100%) levert. Dat is niet het geval; Zeezorg gaat een  deel hiervan leveren. Daarom is een nieuwe  zorgtoewijzing nodig.  In de AW39 is geen Mutatie opgenomen; De Molen kan  de zorg immers direct leveren. Het bericht bevat alleen  een Aanvraag om de zorgtoewijzing te verdelen tussen beide aanbieders.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
