"data" : [
{
"lang":"nl",
"name":"Stap 8: Melden aanvang zorg CAK   Het zorgkantoor geeft de nieuwe leveringsvorm (en  het nieuwe ZZP) door aan het CAK. Dat doet het zorgkantoor door een startbericht (CA317) naar het CAK te sturen. Het zorgkantoor stuurt geen  stopbericht (CA319).   Uit deze zogenaamde MAZ op MAZ situatie kan het CAK afleiden dat de leveringsvorm Verblijf op 5 juli is overgegaan in de leveringsvorm VPT (en dat het geleverde ZZP is gewijzigd).",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
