"name":"Stap 5: Aanvragen aangepaste zorgtoewijzing   Al gauw blijkt dat de heer Van der Steen beter op zijn plek zou zijn in een aanleunwoning met een VPT. Hij zou daar samen met zijn vrouw kunnen gaan wonen. Hiervoor is een zorgtoewijzing voor 6VV nodig.   Op 5 juli kan de heer Van der Steen verhuizen  naar een tweepersoons wooneenheid. De Boomgaard stuurt een mutatiebericht met een aanvraag aangepaste zorgtoewijzing naar het zorgkantoor.",
