"lang":"nl",
"name":"OP351: De zorgaanbieder die het opnamedeel van het verblijf levert, meldt bij aanvang zorg of hij wel of geen behandeling levert.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Voor het declareren van farmacie en hulpmiddelen is het van belang om te weten of een Wlz-client die in een instelling woont, verblijf met of zonder behandeling ontvangt. Deze informatie wordt afgeleid uit de declaratie Wlz. Door in de melding aanvang zorg al door te geven of er wel of geen sprake is van behandeling, is deze informatie eerder beschikbaar.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK35","id":30585,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP351"}}}]
