"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien een aanvraag aangepaste zorgtoewijzing (AAT) niet van toepassing is, mag alleen de dossierhouder aan het zorgkantoor een wijziging van dossierhouderschap doorgeven en mag alleen de coordinator zorg thuis aan het zorgkantoor een wijziging van co&#246;rdinator zorg thuis doorgeven.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP317"}}}]
