"28101" : {
"id":28101,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Aanvragen andere zorg",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\"></span><span style=\" font-size: 9pt; font-family: Verdana;\">Als een andere leveringsvorm gewenst is dan toegewezen vraagt de zorgaanbieder via de AAT een andere leveringsvorm aan. Hetzelfde geldt voor een ander zorgprofiel, wanneer de zorg door meer dan 1 zorgaanbieder geleverd gaat worden of wanneer de zorg door een andere zorgaanbieder (tijdelijk) geleverd zal worden kan dat door middel van een AAT aangevraagd worden. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
