"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Ook de keuze van een client om geen zorg te willen ontvangen of het feit dat zorg niet (meer) door een zorgaanbieder geleverd kan worden moet gezien worden als een mutatie in de zorglevering.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Als de zorgaanbieder de leveringsstatus (inclusief classificatie) niet binnen de termijn van 5 werkdagen na ontvangst van de zorgtoewijzing kan vaststellen, is een termijn van 10 werkdagen van toepassing.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP181","geen technische regels":false}}}]
