"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP315: De zorgaanbieder die een aanvraag aangepaste zorgtoewijzing (AAT) voor verblijf of deeltijdverblijf indient bij het zorgkantoor, geeft in de aanvraag aan bij welke aanbieder de client wordt opgenomen.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien meer aanbieders bij de zorglevering aan de client betrokken zijn, wordt op deze manier duidelijk bij welke aanbieder de client is opgenomen en welke aanbieder(s) &nbsp;<p style=\"margin-top: 3pt;\"> in geval van verblijf, uitsluitend dagbesteding of behandeling levert (leveren); &nbsp;<p style=\"margin-top: 3pt;\"> in geval van deeltijdverblijf, de zorg thuis levert (leveren). &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP315"}}}]
}
]
