"lang":"nl",
"name":"OP326: Een gewijzigd bericht kan verwijderd worden.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een bericht dat eerder met status aanlevering '2' (Gewijzigde aanlevering) gewijzigd is, kan verwijderd worden met status aanlevering '3' (Verwijderen aanlevering).&nbsp;<p style=\"margin-top: 3pt;\">Resultaat van deze verwijdering is dat de aanlevering in zijn geheel (zowel de oorspronkelijke als de gewijzigde aanlevering(en)) komt te vervallen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CA319","id":29113,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP326"}}}]
