"data" : [
{
"lang":"nl",
"name":"OP152: Een aanvraag aangepaste zorgtoewijzing voor MPT, VPT of DTV moet altijd een compleet overzicht bevatten van de te leveren zorg voor de aangevraagde leveringsvorm, vanaf de (kleinste) gewenste startdatum.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Eerder toegewezen zorg die de aangevraagde leveringsvorm betreft en die niet wordt aangevraagd vanaf de (kleinste) gewenste startdatum, wordt niet door het zorgkantoor toegewezen en de eventueel aanwezige zorgtoewijzingen voor deze leveringsvorm</span><span style=\" font-size: 10pt;\"><b> </span><span style=\" font-size: 10pt;\"></b>worden ingetrokken. &nbsp;<p style=\"margin-top: 3pt;\">Eerder toegewezen zorg die een andere dan de aangevraagde leveringsvorm betreft, wordt niet ingetrokken op basis van deze aanvraag aangepaste zorgtoewijzing. &nbsp;<p style=\"margin-top: 3pt;\">pgb-regels worden niet in de aanvraag opgenomen. &nbsp;<p style=\"margin-top: 3pt;\">Deze OP is een aanvulling op/hoort bij OP335.</span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP152","geen technische regels":false}}}]
}
]
