"36413" : {
"id":36413,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Aanvragen aangepaste toewijzing  Zorg thuis organiseren met een MPT is goed mogelijk maar is helaas niet de beste oplossing. Mevrouw Tuin voelt zich onzeker door de ademhalingsondersteuning en heeft behoefte aan meer toezicht dichtbij. In overleg met mevrouw Tuin wordt besloten dat verhuizen naar een woonzorg-complex in de buurt een betere op-lossing is. De Kersentuin levert daar alle benodigde zorg in de vorm van een VPT.   De Fruitmand vraagt bij het zorgkantoor alvast leveringsvorm VPT aan voor De Kersentuin. Omdat de woning niet direct beschikbaar is, wijzigt voor De Fruitmand en De Kersentuin nog niets aan de levering van het MPT. Ook de leveringsstatus  (In Zorg) en de soort zorgtoewijzing (Regulier) blijven bij beide aanbieders ongewijzigd voor het MPT. Wachtlijstbeheer voor woningen valt buiten de verantwoordelijkheid van de Wlz. De Kersentuin heeft in het woonzorgcomplex  geen wachtlijst voor het VPT, daarom blijft het MPT regulier toegewezen en wordt niet soort zorgtoewijzing Overbrugging aangevraagd voor het MPT.  De Fruitmand levert daarom bij de AAT geen mutatie aan voor het MPT.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
